vector<string> ans;

void generate(string s, int sum, int last, int n) {
    if (sum == n) {
        ans.push_back(s);
        return;
    }
    for (int j = 1; j <= n - sum; ++j) {
        generate(s + (s.empty() ? "" : "+") + to_string(j), sum + j, j, n);
    }
}

int main() {
    int n;
    cin >> n;
    generate("", 0, 1, n);
    for (const auto &i : ans) {
        cout << i << '\n';
    }
    return 0;
}
